import React from "react"
import './App.css';

function Message(props) {

    // Checkboxes START
    let greenCheck = <div class="animation-ctn">
                        <div class="icon icon--order-success svg">
                            <svg xmlns="http://www.w3.org/2000/svg" width="154px" height="154px">  
                            <g fill="none" stroke="#22AE73" stroke-width="2"> 
                                <circle cx="77" cy="77" r="72" style="stroke-dasharray:480px, 480px; stroke-dashoffset: 960px;"></circle>
                                <circle id="colored" fill="#22AE73" cx="77" cy="77" r="72" style="stroke-dasharray:480px, 480px; stroke-dashoffset: 960px;"></circle>
                                <polyline class="st0" stroke="#fff" stroke-width="10" points="43.5,77.8 63.7,97.9 112.2,49.4 " style="stroke-dasharray:100px, 100px; stroke-dashoffset: 200px;"/>   
                            </g> 
                            </svg>
                        </div>
                    </div>

    let redCheck = <div class="animation-ctn checkBoxPlacement">
                        <div class="icon icon--order-success svg">
                            <svg xmlns="http://www.w3.org/2000/svg" width="154px" height="154px">  
                            <g fill="none" stroke="#F44812" stroke-width="2"> 
                                <circle cx="77" cy="77" r="72" style="stroke-dasharray:480px, 480px; stroke-dashoffset: 960px;"></circle>
                                <circle id="colored" fill="#F44812" cx="77" cy="77" r="72" style="stroke-dasharray:480px, 480px; stroke-dashoffset: 960px;"></circle>
                                <polyline class="st0" stroke="#fff" stroke-width="10" points="43.5,77.8  112.2,77.8 " style="stroke-dasharray:100px, 100px; stroke-dashoffset: 200px;"/>   
                            </g> 
                            </svg>
                        </div>
                    </div>
    // Checkboxes END

    const Spinner = () => (
        <React.Fragment>
          <style>
          {`
          .spinner .background {
            fill: #555;
          }
          .spinner .line {
            animation: PacMan 5s infinite;
            fill: none;
            stroke: #d26188;
            stroke-width: 25;
          }
          .spinner .spinner {
            animation: Spin 2s infinite linear;
          }
          @keyframes PacMan {
            0% {
              stroke-dasharray: 79px 79;
            }
            50% {
              stroke-dasharray: 1px 79;
            }
            100% {
              stroke-dasharray: 79px 79;
            }
          }
          @keyframes Spin {
            0% {
              transform: rotate(0deg);
            }
            100% {
              transform: rotate(360deg);
            }
          }
          `}
          </style>
          <svg class="spinner" width="150" height="150" viewBox="0 0 100 100">
            <circle class="background" r="24" cx="50" cy="50"></circle>
            <path
              class="line"
              d="M 37.5,50 C 37.5,43.096441 43.096441,37.5 50,37.5 C 56.903559,37.5 62.5,43.096441 62.5,50 C 62.5,56.903559 56.903559,62.5 50,62.5 C 43.096441,62.5 37.5,56.903559 37.5,50"
            ></path>
          </svg>
        </React.Fragment>
      )

    return (
        <div>
            <Spinner />

            <div className='message'>
                <span class='messageText'>Analysing Inputs</span>
            </div>

        </div>   

    )

};

export default Message;
